import AboutContainer from '../components/AboutContainer';

import Header from '../components/Header';

const Index: NextPage = () => {
    return (
        <div>
            <IntroContainer />
            <ForSaleContainer />
            <GalleryContainer />
            <AboutContainer />
        </div>
    );
};

export default Index;
